import { useState } from "react";
import Tabs, { Tab } from "react-best-tabs";
import "react-best-tabs/dist/index.css";
import "./App.css";
import SingleTitle from "./components/SingleTitle";

function App() {
  const [titleType, setTitleType] = useState(false);

  const onTitleClick = () => {
    console.log("hello");
    setTitleType(titleType);
  };

  return (
    <div>
      {/* header */}
      <div
        style={{
          backgroundColor: "#B1BC55",
          margin: 0,
          height: 50,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "white",
        }}
      >
        <div>Caption Generator</div>
      </div>

      {/* caption-category */}
      <div style={{ marginTop: 50, margin: 50 }}>
        <SingleTitle
          text={"Trending"}
          filled={titleType}
          onClick={() => {
            onTitleClick();
          }}
        />
      </div>
    </div>
  );
}

export default App;
